export class CardassianUniformPack extends BaseNeckProvider implements IUniformPack {

    getUniformSwatches() {
        return [
            new Swatch(BodyType.AverageMale, "Average Male", (token) => UniformCatalog.decorateSwatch(this.getNeck(BodyType.AverageMale, token.skinColor, undefined, UniformEra.Cardassian) + CardassianUniform.female, BodyType.AverageMale, token), "BodyType.averageNonBinary"),
            new Swatch(BodyType.AverageFemale, "Average Female", (token) => UniformCatalog.decorateSwatch(this.getNeck(BodyType.AverageFemale, token.skinColor, undefined, UniformEra.Cardassian) + CardassianUniform.female, BodyType.AverageMale, token), "BodyType.averageNonBinary"),
        ];
    }

    getRankSwatches() {
        return [
            new Swatch(Rank.None, "None", (token) => RankIndicatorCatalog.decorateSwatch("", Rank.None, token), "Rank.none.name"),
        ];
    }

    getRankIndicator(token: Token) {
        return "";
    }

    getRankBorderIndicator(token: Token) {
        return "";
    }

    getRankBorderDefinitions(token: Token, bordered: boolean) {
        return "";
    }

    getBorderColor(token: Token) {
        return "#68d3c2";
    }

    getUniformVariantSwatches(token: Token) {
        return [];
    }

    getBorderLogo(token: Token): string {
        return "";
    }

    isDivisionColorSupported(token: Token): boolean {
        return false;
    }

    getUniformAndVariantBody(token: Token) {
        let result = CardassianUniform.female;
        let neck = this.getNeck(BodyType.AverageFemale, token.skinColor, token.species, UniformEra.Cardassian);
        return neck.replace(SpeciesRestrictions.DEFAULT_SKIN_COLOR_REGEX, token.skinColor) + result;
    }
}